const cartItem = () => {
    let items = localStorage.getItem("cart_items")
    if(items=null){
        return []
    }
}

const CartReducer = (state = cartItem(),action) => {
    switch(action.type){
        case 'FETCH_ALL_CART':
            return state
        case 'ADD_CART':
            return state
        case 'DELETE_CART':
            return state
        case 'UPDATE_CART':
            return state
        default:
            return state
    }
}

export default CartReducer
